#[test]
fn validate_signature() {
    let request: super::AuthRequest = super::parse_message(DATA).unwrap();
    // valid signature
    match super::validate_signature(&request, "Q8bhjhRpKAEvJ431vvLbdfXwsEgezr5EqE".to_string()) {
        Ok(()) => println!("{}", "Ok"),
        Err(error) => assert!(false),
    };
    // invalid signature
    match super::validate_signature(&request, "Q8bhjhRpKAEvJ431vvLbdfXwsEgezr5zzz".to_string()) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
}

