#[test]
fn validate_amounts() {
    let request: super::AuthRequest = super::parse_message(DATA).unwrap();
    let auth_min_amount: u64 = 1;
    let auth_max_amount: u64 = 2100000000000000;
    // values are in the range
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => println!("{}", "Ok"),
        Err(error) => assert!(false),
    };
    // values are under the range
    let auth_min_amount: u64 = 1000;
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };
    // values are over the range
    let auth_min_amount: u64 = 0;
    let auth_max_amount: u64 = 1;
    match super::validate_amounts(&request, auth_min_amount, auth_max_amount) {
        Ok(()) => assert!(false),
        Err(error) => println!("{}", "Ok"),
    };

}

