#[test]
fn issuerauthorizer_post() {
    let client = Client::new(super::rocket()).expect("valid rocket instance");
    let mut response = client.post("/issuerauthorizer").body(DATA).dispatch();
    let result = json!({
        "result": true,
        "error": "",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
    let mut response = client.post("/issuerauthorizer").body(DATA_INVALID).dispatch();
    let result = json!({
        "result": false,
        "error": "invalid signature",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
    let mut response = client.post("/issuerauthorizer").body(DATA_INVALID_2).dispatch();
    let result = json!({
        "result": false,
        "error": "invalid message",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
    let mut response = client.post("/issuerauthorizer").body(DATA_INVALID_3).dispatch();
    let result = json!({
        "result": false,
        "error": "invalid input",
    });
    assert_eq!(response.body_string(), Some(result.to_string()));
}

#[test]
fn test_bitcoin_signature_code() {
    let secp = bitcoin::secp256k1::Secp256k1::verification_only();
    let signature = &"H7WazCRR1Lp900DQYrqC1T1k72jqVCd1g2ppHYbSYsO8URol0UU+Ahny5DdkjDDFjQ7JNEqScDS18SJBXPka6Yw=";
    let message = "pippo";
    let sig = base64::decode(&signature).unwrap();
    let recid = bitcoin::secp256k1::recovery::RecoveryId::from_i32(i32::from((sig[0] - 27) & 3)).unwrap();
    let recsig = bitcoin::secp256k1::recovery::RecoverableSignature::from_compact(&sig[1..], recid).unwrap();
    let hash = bitcoin::util::misc::signed_msg_hash(&message);
    let msg = bitcoin::secp256k1::Message::from_slice(&hash[..]).unwrap();

    let pubkey = bitcoin::util::key::PublicKey {
        key: secp.recover(&msg, &recsig).unwrap(),
        compressed: ((sig[0] - 27) & 4) != 0,
    };
    assert_eq!(pubkey.to_string(), "0293dae062852666a7526d5feea343aa7cbcf4eb1cd4ccf2c658c65563a577a45e".to_string());

    let address = bitcoin::Address::p2pkh(&pubkey, bitcoin::network::constants::Network::Bitcoin);
    assert_eq!(address.to_string(), "1Gdknx9YDdzvQVAEevHCXSugbq7jsefmZc".to_string());
}

#[test]
fn test_elements_signature_code() {
    let secp = elements::bitcoin::secp256k1::Secp256k1::verification_only();
    let signature = &"H7WazCRR1Lp900DQYrqC1T1k72jqVCd1g2ppHYbSYsO8URol0UU+Ahny5DdkjDDFjQ7JNEqScDS18SJBXPka6Yw=";
    let message = "pippo";
    let sig = base64::decode(&signature).unwrap();
    let recid = elements::bitcoin::secp256k1::recovery::RecoveryId::from_i32(i32::from((sig[0] - 27) & 3)).unwrap();
    let recsig = elements::bitcoin::secp256k1::recovery::RecoverableSignature::from_compact(&sig[1..], recid).unwrap();
    let hash = elements::bitcoin::util::misc::signed_msg_hash(&message);
    let msg = elements::bitcoin::secp256k1::Message::from_slice(&hash[..]).unwrap();

    let pubkey = elements::bitcoin::util::key::PublicKey {
        key: secp.recover(&msg, &recsig).unwrap(),
        compressed: ((sig[0] - 27) & 4) != 0,
    };
    assert_eq!(pubkey.to_string(), "0293dae062852666a7526d5feea343aa7cbcf4eb1cd4ccf2c658c65563a577a45e".to_string());

    let address = elements::Address::p2pkh(&pubkey, None, &elements::AddressParams::LIQUID);
    assert_eq!(address.to_string(), "QCu8v98xgvQs2C7B3qGNAbRXUaoWKgEpWH");
}
